                    <h3 class="title--bar">
                        We have the non-proprietary replacement on hand.
                    </h3>
                    <p>CrestTec is dedicated to providing the Semiconductor industry with the parts, knowledge and engineered solutions dedicated to enhancing ultraclean processing and maximizing fab manufacturing productivity. We are driven to help our customers achieve optimal tool performance at a lower overall cost of ownership.</p>
                    <p>Supporting all tool sets and processes, our specialists have over 60 years combined experience in high-tech manufacturing and engineering support and have engineered custom solutions for some of the most complicated Semiconductor applications.</p>
